import React, { Component } from 'react'

class New extends Component {
  constructor(props) {
  super(props);
  state={
    count: 0,
    address: '',
    street: ''
  };
}
  render () {
    return (
      <div>
      <span>{this.state.count}</span>
      <button> Increment </button>
      </div>

    );

  }
}

export default New;
